description:
Join us as we study the new Jerusalem in REVELATION 21. Herein, we read how God wipes away all tears; there will be no more death, sorrow, nor pain. Let us set our eyes on Jesus, the ever-shining Light, as we grow in Biblical understanding of heaven.
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
